import React from "react";
import {View, Text,Button ,StyleSheet, TouchableOpacity} from "react-native";
import { Video, ResizeMode } from "expo-av";

const HomeScreen = () => {
    const video = React.useRef(null);
    const [status, setStatus] = React.useState({});

    return (
       
      <View >
     <Image
        style={styles.logo}
        source={{
          uri: 'https://media.istockphoto.com/id/177436977/es/foto/caja-de-herramientas-roja-con-herramientas-de-madera-sobre-fondo-blanco.jpg?s=612x612&w=0&k=20&c=vh1y5GEKRrop3U9ccYJqTdGtSheFo1Bi9zWSD0KP8Vw=',
        }}
      />
    </View>
  );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: "#fff",
        alignItems: "center",
        justifyContent: "center",
    },
    video: {
        flex: 1,
        alignSelf: "stretch"
    },
    buttons: {
        margin: 16
    }
})

export default HomeScreen;
